    ;                                                                                                                  // 8887
    yAxis                                                                                                              // 8888
        .orient('bottom')                                                                                              // 8889
        .tickFormat(d3.format(',.1f'))                                                                                 // 8890
    ;                                                                                                                  // 8891
                                                                                                                       // 8892
    tooltip                                                                                                            // 8893
